              sed tristique mi semper. Sed porta libero ut consectetur suscipit.
              Duis in sodales ligula. Praesent vehicula posuere mollis.
            </span>
          </Col>
          <Col sm={5} className="right-col">
            <img
              src={MyImage}
              width="450"
              height="400"
              alt="Raffay's Picture"
              className="right-col-image"
            ></img>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default AboutMePage;
